export const Image = ({ title, listImg}) => {
  return (
    <div>
      <div >
        {' '}
        <a href={listImg}>
          <div >
            <h4>{title}</h4>
          </div>
          <img
            src={listImg}

            alt={title}
          />{' '}
        </a>{' '}
      </div>
    </div>
  )
}
